`timescale 1ns / 1ps

module MULT (
    input clk,
    input ena,
    input isUnsigned,
    input signed [31:0] a,
    input signed [31:0] b,
    output reg signed [63:0] z,
    output carry,
    output busy
);

reg lastEna;
(* dont_touch = "yes" *) reg [7:0] counter;
localparam COUNTER_CYCLE = 25;

always @(posedge clk) begin
    // negedge of main clk
    lastEna <= ena;
    if (ena != lastEna)
    begin
        counter <= 0;
    end
    else if (ena) begin
        counter <= counter + 1;
    end
end

assign busy = ena & (counter != COUNTER_CYCLE);

reg [31:0] ax, bx;
wire [63:0] zx;

always @(a or b or isUnsigned) begin
    if(isUnsigned == 1'b1) begin
        ax = a;
        bx = b;
    end else begin
        ax = a[31] ? -a : a;
        bx = b[31] ? -b : b;
    end
end

